INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 2, 1, 0, 0, 0, 1.4, 0, "春咲 ひより", 1, 1001, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, "お！\nあそこに困ってそうな人発見！");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "わ、わたし、\nなに言ってるんだろ\nあはは…", 2, 1, 0, 0, 0, 1.4, 0, "草野 優衣", 1, 1002, "みんなみたいに\nわたしも強くならなきゃ", 0, "大切な人を\n守れるようになりたい…って");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "少しは磨かれると思いますよ。", 2, 1, 0, 0, 0, 1.4, 0, "士条 怜", 1, 1003, "フェンシングを始めてみては？", 0, "キミに必要な集中力と感性が");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "みそぎはねぇ、\nかくれんぼやりたい！", 2, 1, 0, 0, 0, 1.5, 0, "穂高 みそぎ", 1, 1004, "ねぇ、にいちゃん！", 0, "今日はなにして遊ぶ？");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "私といっしょに…\nいかない？", 2, 1, 0, 0, 0, 1.4, 0, "風宮 あかり", 1, 1006, "風宮あかりです", 0, "ねぇ…");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "食べ物の恨みは怖いのー", 2, 1, 0, 0, 0, 1.5, 0, "出雲 宮子", 1, 1007, "出雲宮子なのー", 0, "プリンたべたいのー");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "いいよ。\n見られることは運命さ…", 2, 1, 0, 0, 0, 1.4, 0, "虹村 雪", 1, 1008, "ボクは虹村雪。", 0, "キミもボクの美貌に\n吸い寄せられたんだね。");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "人呼んで「疾風の冥姫」!!", 2, 1, 0, 0, 0, 1.4, 0, "柊杏奈", 1, 1009, "フッ…聞いて後悔するがいい！", 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ほんまおおきにやわ～♪", 2, 1, 0, 0, 0, 1.5, 0, "姫宮 真歩", 1, 1010, "マホマホ王国のプリンセス、\nまほ姫どす", 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ここで会ったが\n100年目～！", 2, 1, 0, 0, 0, 1.4, 0, "衣之咲 璃乃", 1, 1011, "衣之咲璃乃です！", 0, "生き別れたお兄ちゃんを探して\n三千世界！");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "…って、お願い！\n誰にも言わないでおいて～！", 2, 1, 0, 0, 0, 1.4, 0, "柏崎 初音", 1, 1012, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, "ち、超能力って…\n何のことかな～？");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 2, 1, 0, 0, 0, 1.4, 0, "美波 鈴奈", 1, 1016, "ちょす！\n美波鈴奈だよ～♪", 0, "一応カリスマ読モJKやってまっす！");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "でも、沖縄もとってもいいとこさー", 2, 1, 0, 0, 0, 1.4, 0, "喜屋武 香織", 1, 1017, "はいたーい。\n喜屋武香織さー。", 0, "東京は遊園地みたいなところさー");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "イオちゃんって呼んでね。", 2, 1, 0, 0, 0, 1.4, 0, "支倉 伊緒", 1, 1018, "支倉伊緒です。", 0, "先生って呼ばれるのは\nくすぐったいから");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ミミをおいてかないでぇ～", 2, 1, 0, 0, 0, 1.5, 0, "茜 ミミ", 1, 1020, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, "あ！/\お兄ちゃ～ん\nまってよ～");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ふぇぇぇぇぇん……", 2, 1, 0, 0, 0, 1.5, 0, "栗林 くるみ", 1, 1021, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, "あの……\nふぇ……");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "なんてありがとうございます！", 2, 1, 0, 0, 0, 1.4, 0, "風宮 より", 1, 1022, "風宮よりです。\nあああああ！", 0, "こんな私に貴重な時間を\n割いていただき、");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "私こっち行きたいー\nね、早く早くー", 2, 1, 0, 0, 0, 1.5, 0, "北条 綾音", 1, 1023, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, "おにいちゃんどこいくの？\nえ？");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "これて何か違う…\nあああすみません！", 2, 1, 0, 0, 0, 1.4, 0, "天野 すずめ", 1, 1025, "わっ…わっ…私、\n天野すずめといいます！", 0, "ふ、不束者ですが\nどうぞ末永く…って、");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "離しませんわ………\n絶対に…!!", 2, 1, 0, 0, 0, 1.4, 0, "倉石 恵理子", 1, 1027, "……クスクス…私は\n…倉石恵理子……", 0, "あなたは…運命の……\n伴侶……");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "…そうでしょ？？", 2, 1, 0, 0, 0, 1.4, 0, "佐々木 咲恋", 1, 1028, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "あはは、\n私もまだまだだなぁ～", 2, 1, 0, 0, 0, 1.4, 0, "桜井 望", 1, 1029, "桜井望だよ！\nよろしくねっ", 0, "ぇっと…\nキミ、私のこと知らないの?!");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ショーグン、\nワタシと一緒に天下統一デース！", 2, 1, 0, 0, 0, 1.4, 0, "ニノン・ジュベール", 1, 1030, "デケデケデンっ！", 0, "初めまして、\n私はニノン・ジュベール申すデス！");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "おかしいですね……", 2, 1, 0, 0, 0, 1.4, 0, "上喜 しのぶ", 1, 1031, "上喜しのぶです。\n手元のドクロが父です。", 0, "でもって私の隣にいるのが……\nえ、見えない？");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "そう、\nオラのボケに突っ込める相方が…！", 2, 1, 0, 0, 0, 1.5, 0, "野戸まひる", 1, 1033, "目指すはビッグな\nお笑い芸人だっぺ！", 0, "けんども\nそれには足りないモンが…");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ちょ\nちょっと一杯飲んできます…！", 2, 1, 0, 0, 0, 1.4, 0, "綾瀬 ゆかり", 1, 1034, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, "ちょっと緊張しちゃって…");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "これ以上お話しすることは…\nないです！", 2, 1, 0, 0, 0, 1.5, 0, "氷川 鏡華", 1, 1036, "氷川鏡華…です", 0, "知らない人とは話しちゃいけないので");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 2, 1, 0, 0, 0, 1.4, 0, "柏崎 栞", 1, 1038, "柏崎…栞です。", 0, "……あ、アラーム。");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "野に咲く花が、\n唯一の話相手です。", 2, 1, 0, 0, 0, 1.4, 0, "双葉 碧", 1, 1040, "ふ、双葉碧です。", 0, "私、一人も友達がいなくて……");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "そう思っています。", 2, 1, 0, 0, 0, 1.4, 0, "三角 千歌", 1, 1042, "三角千歌です。", 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "う、疑ってすまなかったな…", 2, 1, 0, 0, 0, 1.4, 0, "安芸 真琴", 1, 1043, "安芸真琴だ。", 0, "あぁ？\nお前のそいつの仲間か？");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 2, 1, 0, 0, 0, 1.4, 0, "イリヤ・オーンスタイン", 1, 1044, "わらわこそは夜を総べる者！", 0, "生けとし生ける全ての者よ！");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "ｌク、クウカに何かご用ですか!?", 2, 1, 0, 0, 0, 1.4, 0, "遠見 空花", 1, 1045, "そこで騎士は妖精を乱暴に……", 0, "ぐふふふふ……はっ！");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "う～ん…\n猫ってホントに最高にゃ～♪", 2, 1, 0, 0, 0, 1.4, 0, "宮坂たまき", 1, 1046, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 2, 1, 0, 0, 0, 1.4, 0, "大神 美冬", 1, 1048, "大神美冬よ！", 0, "それでは早速クエストに…");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 2, 1, 0, 0, 0, 1.4, 0, "星野静流", 1, 1049, "星野静流だよ！", 0, "クエストもバトルも\n掃除も洗濯も");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 2, 1, 0, 0, 0, 1.5, 0, "玉泉美咲", 1, 1050, "アタシは玉泉美咲。", 0, "見ての通りの\nセクシー美少女で");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "？？？？", 2, 1, 0, 0, 0, 1.4, 0, "リマ", 1, 1052, "？？？", 0, "？？？？");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "そ、そこまでいうなら\nもらってやる", 2, 1, 0, 0, 0, 1.5, 0, "モニカ・ヴァイスヴィント", 1, 1053, "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "そ、そこまでいうなら\nもらってやる", 2, 1, 0, 0, 0, 1.5, 0, "ペコリーヌ", 1, 1058, "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "そ、そこまでいうなら\nもらってやる", 2, 1, 0, 0, 0, 1.5, 0, "コッコロ", 1, 1059, "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……");
INSERT INTO `v1_ca5de4099cba40ae716c68e3e53dc6fa9577edcd78d523de6a7f2716a9b84822` VALUES (1, "そ、そこまでいうなら\nもらってやる", 2, 1, 0, 0, 0, 1.5, 0, "キャル", 1, 1060, "モニカ・ヴァイスヴィントだ。", 0, "菓子でつろうなどと\n稚拙な策を……");
